import React from 'react';
import { Button, Container, Grid } from '@mui/material';
import NavigationBar from '../components/NavBar'; // Make sure to adjust the import path
import Blog from './Blog'; // Make sure to adjust the import path
import '../styles/Styles.css';

const Screen = () => {
	return (
		<Container>
			<Grid container justifyContent="flex-end" alignItems="flex-start" spacing={2}>
				<Grid item xs={12}>
					<Button variant="outlined" className='navButton login-link'>
            Log-in / Registrarse
					</Button>
				</Grid>
				<Grid item xs={12} className='backgroundContainer'>
					<NavigationBar />
					<Blog />
				</Grid>
			</Grid>
		</Container>
	);
};

export default Screen;
